function Tours(tours) {
    return (
        <div>
            <div>
                <h2> Plan with rohit</h2>
            </div>            
            <div>
                {
                    tours.map((tours) => {
                        return <Card></Card>
                    })
                }
            </div>
        </div>
    );
}

export default Tours;
